SELECT AVG(loans.bal) AS avg_loan_balance
FROM loans
JOIN deposits ON loans.cus_id = deposits.cus_id;

SELECT AVG(deposits.bal) AS average_deposit_balance
FROM deposits
JOIN loans ON deposits.cus_id = loans.cus_id;

SELECT COUNT(*) FROM deposits 
WHERE cus_id IN (SELECT cus_id FROM cards) 
AND EXTRACT(YEAR FROM de_st_dt) > 2021;

SELECT AVG(loan_count) AS average_loans_per_customer
FROM (
    SELECT cus_id, COUNT(*) AS loan_count
    FROM loans
    GROUP BY cus_id
) AS loans_per_customer;

SELECT COUNT(DISTINCT accounts.cus_id) AS num_customers_with_accounts_and_cards
FROM accounts
JOIN cards ON accounts.cus_id = cards.cus_id;

SELECT COUNT(DISTINCT cus_id) AS customer_count
FROM deposits
WHERE cus_id IN (SELECT cus_id FROM deposits GROUP BY cus_id HAVING COUNT(id) > 2);

SELECT COUNT(DISTINCT a.cus_id) AS customer_count
FROM accounts a
JOIN loans l ON a.cus_id = l.cus_id;

SELECT COUNT(*) FROM transactions t 
JOIN accounts a ON t.acc_id = a.id 
JOIN customers c ON a.cus_id = c.id;

SELECT COUNT(*) AS active_deposits_count
FROM deposits
WHERE de_en_dt IS NULL OR de_en_dt > CURRENT_DATE;

SELECT COUNT(*) FROM deposits d
JOIN deposit_types dt ON d.de_type_id = dt.id
WHERE dt.de_type = 'Savings Account';
